import React from "react";
import { AppBar, Toolbar, Typography, Button, Menu, MenuItem, IconButton, Box } from "@mui/material";
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircle from '@mui/icons-material/AccountCircle';

function Navbar({ onOrderClick, orderAnchorEl, handleOrderClose }) {
  return (
    <AppBar position="static" sx={{ background: "#e53935", minHeight: 60 }}>
      <Toolbar>
        <Box mr={2}>
          <img src="/fuelnowlogo.png" alt="FUELnow" style={{ height: 40 }} />
        </Box>
        <Typography variant="h6" component="div" sx={{ flexGrow: 0, fontWeight: 700 }}>
          FUELnow
        </Typography>
        <Button color="inherit" sx={{ ml: 4 }}>HOME</Button>
        <Button
          color="inherit"
          onClick={onOrderClick}
          sx={{ ml: 2 }}
        >ORDER</Button>
        <Menu
          anchorEl={orderAnchorEl}
          open={Boolean(orderAnchorEl)}
          onClose={handleOrderClose}
        >
          <MenuItem onClick={handleOrderClose}>New Order</MenuItem>
          <MenuItem onClick={handleOrderClose}>Order History</MenuItem>
        </Menu>
        <Button color="inherit" sx={{ ml: 2 }}>REPORTS</Button>
        <Button color="inherit" sx={{ ml: 2 }}>CUSTOMER SERVICES</Button>
        <Box sx={{ flexGrow: 1 }} />
        <Box display="flex" alignItems="center">
          <Typography color="inherit" sx={{ mr: 2 }}>
            Hello, Jai Devarajan
          </Typography>
          <IconButton color="inherit">
            <AccountCircle />
          </IconButton>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
